import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material';

const Header = () => {

  return (
    <header>
      <AppBar position="static" className={classes.appBar}>
        <Toolbar>
          <Typography variant="h6" className={classes.title}>
            Mi Portafolio
          </Typography>
        </Toolbar>
      </AppBar>
    </header>
  );
};

export default Header;
